#include <cstddef>
#include <cstdint>

#include "/src/xpdf-4.05/xpdf/Object.h"
#include "/src/xpdf-4.05/xpdf/Dict.h"
#include "/src/xpdf-4.05/xpdf/GfxState.h"
#include "/src/xpdf-4.05/xpdf/SplashOutputDev.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *Data, size_t Size) {
    // Create an instance of SplashOutputDev
    SplashColorMode colorModeA = splashModeRGB8;
    int bitmapRowPadA = 4;
    GBool reverseVideoA = gFalse;
    SplashColor paperColorA;
    paperColorA[0] = paperColorA[1] = paperColorA[2] = paperColorA[3] = 0;
    SplashOutputDev splashOutputDev(colorModeA, bitmapRowPadA, reverseVideoA, paperColorA);

    // Create a GfxState object
    double hDPIA = 72.0;
    double vDPIA = 72.0;
    PDFRectangle pageBox;
    int rotateA = 0;
    GBool upsideDown = gFalse;
    GfxState gfxState(hDPIA, vDPIA, &pageBox, rotateA, upsideDown);

    // Call the updateFont function
    splashOutputDev.updateFont(&gfxState);

    return 0;
}
